var mesh,image,imageBump;
var nImage=0;
var incli=-17*Math.PI/180; 
var retro=true;
var noAxe=false;
var hasSat=true;
var distSol=5.9e9;

function avanceImage() {
	nImage++;
	if (nImage>0) {
		geometry = new THREE.SphereGeometry( 350, 32,32 );
		var texture = new THREE.Texture( image );
		texture.needsUpdate = true;
		var textureBump = new THREE.Texture( image );
		textureBump.needsUpdate = true;
		var material2 = new THREE.MeshPhongMaterial({
			//map 
			map: texture,
			bumpMap: textureBump,
			bumpScale : 5,
			specular : '#666666',
			specularMap : texture,
			shininess: 2
		  });
	  	var bufferGeometry = new THREE.BufferGeometry().fromGeometry( geometry);  
		mesh = new THREE.Mesh( bufferGeometry, material2 );
		mesh.castShadow = true;
		mesh.rotation.order = "XZY";
		
		scene.add( mesh );
		
		mesh.rotation.z = incli;
		
		ligneAxe.rotation.z=incli;     
		
		animate();		
	}
}


function init_planete(){
     
	image = document.createElement( 'img' );
	image.onload = function () {
		avanceImage();
	}
	image.src='data:image/jpg;base64,';
}
